import Chart from "chart.js/auto";

const BarChart = () => {

    new Chart(
        document.getElementById('myChart'),
        {
            type: 'bar',
            data: {
                labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                datasets: [{
                    label: '# of Votes',
                    data: [12, 19, 3, 5, 2, 3],
                    borderWidth: 1
                }]
            },
            options: {
                scales: {
                    y: {
                        beginAtZero: true
                    }
                }
            }
        }
    );


    return (
        <>
            <div class="stat p-10">
                <div class="stat-value text-center mb-5">Random chart</div>
                <div class="stat-value">
                    <canvas id="myChart"></canvas>
                </div>
                <div class="stat-desc text-center mt-10">Source: source</div>
            </div>

        </>
    )
}

export { BarChart }
